import React from 'react';
import './stylesheet.css';

const weatherAPI = {
  key:"7248eff058ba1f79c53e30c2ba0fac6e",
  base:"https://api.openweathermap.org/data/2.5/"
}

function App() {
  return (
    <div className="app">
      <main>
        <div className="searchBox">
          <input
            type="text"
            className="searchBoxInput"
            placeholder="Enter destination..."
          />
        </div>
      </main>
    </div>
  );
}

export default App;
